import React from "react";


const axios = require('axios');

async function App() {
  try {
    const tickets = await axios.get("http://52.10.102.239/tickets/");
    console.log(tickets.data[0].email)

    return (
      <React.Fragment>
        <tr>
          <th scope="row">{ tickets.data[0].email }</th>
          <td>{ tickets.data.title }</td>
        </tr>
      </React.Fragment>
    );

  } 
  catch (error) {
    console.log(error)
  }
}

export default App;
